import React from "react";
const Temp = () => {
  const count = 0;

  const decr = () => {
    count--;
  };
  const incr = () => {
    count++;
  };

  return (
    <>
      <h1>count</h1>
      <button onClick={decr}>decr</button>
      <button onClick={incr}>incr</button>
    </>
  );
};

export default Temp;
